import {Container, Button} from "./cardStyle";
export default function Card(props) {
   return (
      <Container>
         <Button onClick={props.onClose}>X</Button>
         <Nameh2>{props.name}</Nameh2>
         <h2>{props.status}</h2>
         <h2>{props.species}</h2>
         <h2>{props.gender}</h2>
         <h2>{props.origin}</h2>
         <img src={props.image} alt='' />
      </Container>
   );
}
